import React from 'react';

function TableComponent({ data }) {
    return (
        <table border="1" style={{ margin: '20px auto', width: '80%' }}>
            <thead>
                <tr>
                    <th>Student Name</th>
                    <th>University</th>
                    <th>Program</th>
                    <th>Course Name</th>
                    <th>Course Code</th>
                    <th>Grade</th>
                </tr>
            </thead>
            <tbody>
                {data.map((row, index) => (
                    <tr key={index}>
                        <td>{row.name}</td>
                        <td>{row.university}</td>
                        <td>{row.program}</td>
                        <td>{row.courseName}</td>
                        <td>{row.courseCode}</td>
                        <td>{row.grade}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
}

export default TableComponent;
